import React from 'react';
import { View, ScrollView,Text } from 'react-native';

function Profile(props) {

    return (
        <ScrollView style={{
            height: '100%',
            width: '100%',
            backgroundColor: 'red',
            flexDirection: 'column',
        }}>
            <View style={{
                height:200,
                width:'100%',
                backgroundColor: 'black',
                borderBottomEndRadius:100,
                
            }}>
           

            </View>


        </ScrollView>
    );
}

export default Profile;
